import logo from '../assets/Logo.svg'
import { Link } from 'react-router-dom';
function Navbar(){
    return(
        <div>
            <Link to="/">
            <img src={logo} alt='Logo' width={160} height={32} loading='lazy'></img>
            </Link>

            <nav>
                <ul>
                    <li>
                        Link
                    </li>
                </ul>
            </nav>
        </div>
    )
}
export default Navbar;
